DROP TABLE IF EXISTS ITEM;
CREATE TABLE ITEM (
  ID            BIGINT PRIMARY KEY AUTO_INCREMENT,
  NAME          VARCHAR(255),
  DESCRIPTION   VARCHAR(255) NOT NULL,
  SELLING_PRICE DECIMAL(19, 2) NOT NULL,
  STOCK         BIGINT NOT NULL,
  IMAGE         LONGBLOB
);

